    def waysToReachStair(self, k: int) -> int:
        tt=0
        for index in range(32):
            wwwww_magi = index+1
            e_magi = 2**index - k
            if e_magi < 0:
                continue
            tt += math.comb(wwwww_magi, e_magi)
        return tt
